import React from "react";

const Pokemon = (props) => {
  const types = props.pokemon.types.map((type, index) => {
    return <li key={index}>{type}</li>;
  });
  return (
    <div>
      <img src={props.pokemon.url} alt={props.pokemon.name} />
      <span>{props.pokemon.name}</span>
      <ul>{types}</ul>
    </div>
  );
};

export default Pokemon;
